import React ,{useState}from "react";
import { TextField } from "@material-ui/core";
import { Grid } from "@material-ui/core";


const initailValue = {
  id: 0,
  fullname: "",
  email: "",
  mobile: "",
  city: "",
  gender: "",
  departmentId: "",
  date: new Date(),
  is_permanent: false,
};
function BuyerRegistration() {
  const [values, setValues] = useState(initailValue);
  return (
    <div>
      <form>
        <Grid container>
          <Grid item xs={6}>
            <TextField
              varient="outlined"
              label="Full Name"
              value={values.fullname}
            />
            <TextField
              varient="outlined"
              label="Email"
              value={values.email}
            />
          </Grid>
          <Grid item xs={6}></Grid>
        </Grid>
        this is buyer registration form
      </form>
    </div>
  );
}

export default BuyerRegistration;
